import ListDeviceItem from "../listDeviceItem"

export const renderDeviceList = (device, deviceDisplay) => {
  let container = []
  let i = 0
  while (i < 100) {
    if (!device[i]) break
    container.push(device[i])
    i++
  }
  
  if (deviceDisplay) {
    return container.map((item, i) => (
      <ListDeviceItem
        key={`ID${i}D`}
        mac={item[0].data}
        user={item[1].data}
        primary={item[2].data}
        mask={item[3].data}
        ip={item[4].data}
        location={item[5].data}
      />
    ));
  }
};
